selector_to_html = {"a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bloquear c\u00f3digos de barras con URLs<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Bloquea el escaneo de c\u00f3digos QR URL comenzando con <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Estados Unidos<a class=\"headerlink\" href=\"#america\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#only-enable-2d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitar s\u00f3lo Symbolog\u00edas 2D<a class=\"headerlink\" href=\"#only-enable-2d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar configuraci\u00f3n<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo continuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>El esc\u00e1ner funciona continuamente. Si el escaneo tiene \u00e9xito o el tiempo de escaneo excede el tiempo de trabajo \u00fanico, el escaneo actual termina. Si el tiempo excede el tiempo especificado, el siguiente escaneo se activa autom\u00e1ticamente.</p>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminador<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><h3>Activar<a class=\"headerlink\" href=\"#enable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de autodetecci\u00f3n<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>En el modo de detecci\u00f3n autom\u00e1tica, el esc\u00e1ner detectar\u00e1 el brillo del entorno circundante. Cuando el brillo cambia, el escaneo se activa. El escaneo termina cuando el escaneo es exitoso o el tiempo de escaneo excede el tiempo de trabajo \u00fanico. Independientemente de si el \u00faltimo escaneo fue exitoso o fall\u00f3, se volver\u00e1 a detectar el brillo del entorno circundante.</p>", "a[href=\"system.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar configuraci\u00f3n<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar configuraci\u00f3n<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar configuraci\u00f3n<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#enable-all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitar todas las Symbologies<a class=\"headerlink\" href=\"#enable-all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo lanzador de teclas<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pulse el bot\u00f3n para activar el escaneo, y suelte el bot\u00f3n para finalizar la exploraci\u00f3n. El escaneo termina cuando el escaneo es exitoso o el tiempo de lectura excede el tiempo de lectura simple.</p>", "a[href=\"#w9-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner con cable <strong>W9</strong><a class=\"headerlink\" href=\"#w9-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n de End Caracter<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>El car\u00e1cter final se a\u00f1ade despu\u00e9s de los datos decodificados en el formato de datos decodificados + car\u00e1cter final.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbolog\u00edas<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Iniciar configuraci\u00f3n<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#only-enable-1d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitar s\u00f3lo Symbolog\u00edas 1D<a class=\"headerlink\" href=\"#only-enable-1d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"scanmode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar configuraci\u00f3n<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
